import React from 'react'
import styled from 'styled-components'
import WordCard from '../components/Main/WordCard'

const Cards = styled.div`
  background-color: #f9fafb;
  height: 200px;
  padding-bottom: 5%;
  padding-top: 5%;
  padding-left: 5%;
  padding-right: 5%;
`

function onChange(a, b, c) {
  console.log(a, b, c)
}

const contentStyle = {
  height: '160px',
  color: '#fff',
  lineHeight: '160px',
  textAlign: 'center',
  background: '#364d79',
}

function Main() {
  return (
    <>
      <WordCard />
    </>
  )
}

export default Main
